import React from 'react';
import axios from 'axios';

const User = ({users}) => (
  <div>
    <ul>
      { users.map (user => (
        <li key={user.id}>{user.login}</li>
      ))}
    </ul>
  </div>
);

User.getInitialProps = async () => {
  const response = await axios.get(
    'https://api.github.com/users/rickson-simoes'
    );

  return { users: response.data };
}

export default User;
